const Favorites = () => {
  const favorites = useSelector((state) => state.myFavorites);
  return (
    <div>
      {favorites.map((map) => {
        return (
          <Card
            key={id}
            id={id}
            name={name}
            species={species}
            gender={gender}
            image={image}
            onClose={onClose}
          />
        );
      })}
    </div>
  );
};

export default Favorites;
